    false,nt"url": null,nt"notes": "This annual narrative report for Tewaukon
    NWR and Tewaukon WMD outlines activities and accomplishments during the 2002 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Habitat restoration and management projects
    are also covered; activities include native prairie floristic surveys, grasslands,
    prairie restoration, managed wetlands, water rights, native woodlands, invasive
    plant control, and fire management. Fish and wildlife management are discussed next
    with emphasis on waterfowl, migratory birds, disease, resident wildlife, wildlife
    disturbance, and endangered species. Public use and recreation are summarized including
    fishing, hunting, wildlife observation, and environmental education.",nt"owner_org":
